import React from "react";
import IndexNavbar from "components/Navbars/IndexNavbar.js";
import Footerr from "components/Footers/Footerr";

function NewTicketForm() {
  return (
    <div style={containerStyle}>
      <header style={headerStyle}>
        <IndexNavbar />
      </header>

      <main style={mainStyle}>
        <div style={cardStyle}>
          <div style={headerSection}>
            <div>
              <h1 style={titleStyle}>Nouveau Ticket STB</h1>
              <p style={subtitleStyle}>Support technique de la Banque STB</p>
            </div>
            <button style={returnButtonStyle}>← Retour à la liste</button>
          </div>

          <form style={formStyle}>
            <div style={inputGroup}>
              <label style={labelStyle}>📝 Sujet du ticket</label>
              <input
                type="text"
                placeholder="Ex: Mon accès Internet est bloqué"
                style={inputStyle}
              />
            </div>

            <div style={inputGroup}>
              <label style={labelStyle}>🏢 Département concerné</label>
              <select style={selectStyle}>
                <option>IT - Informatique</option>
                <option>RH - Ressources Humaines</option>
                <option>Comptabilité</option>
              </select>
            </div>

            <div style={inputGroup}>
              <label style={labelStyle}>📄 Description détaillée</label>
              <textarea
                rows="5"
                placeholder="Décrivez votre problème ici..."
                style={textareaStyle}
              />
            </div>

            <button type="submit" style={submitButtonStyle}>
              📨 Envoyer le ticket
            </button>
          </form>
        </div>
      </main>

      <Footerr />
    </div>
  );
}

// Styles complets
const containerStyle = {
  minHeight: '100vh',
  display: 'flex',
  flexDirection: 'column',
  background: `
    linear-gradient(
      160deg,
      rgba(245, 248, 250, 0.98) 0%,
      rgba(240, 245, 250, 0.98) 100%
    ),
    url('https://www.stb.com.tn/images/background-pattern.png')
  `,
  backgroundSize: 'cover',
  backgroundAttachment: 'fixed',
  position: 'relative',
};

const headerStyle = {
  position: 'sticky',
  top: 0,
  zIndex: 1000,
  boxShadow: '0 2px 10px rgba(0,0,0,0.08)',
  background: 'rgba(255, 255, 255, 0.95)',
  backdropFilter: 'blur(6px)',
};

const mainStyle = {
  flex: 1,
  padding: '100px 20px 120px',
  maxWidth: '800px',
  margin: '0 auto',
  width: '100%',
};

const cardStyle = {
  backgroundColor: 'rgba(255, 255, 255, 0.97)',
  borderRadius: '18px',
  padding: '2.5rem',
  boxShadow: '0 8px 30px rgba(0,0,0,0.12)',
  border: '1px solid rgba(240, 242, 245, 0.8)',
  backdropFilter: 'blur(4px)',
};

const headerSection = {
  display: 'flex',
  justifyContent: 'space-between',
  alignItems: 'flex-start',
  marginBottom: '2rem',
  borderBottom: '2px solid #eee',
  paddingBottom: '1.5rem'
};

const titleStyle = {
  fontSize: '1.8rem',
  color: '#0d47a1',
  margin: 0,
  fontWeight: '700'
};

const subtitleStyle = {
  color: '#666',
  fontSize: '0.9rem',
  margin: '0.25rem 0 0 0'
};

const returnButtonStyle = {
  padding: '0.6rem 1.2rem',
  backgroundColor: '#f0f4f8',
  border: 'none',
  borderRadius: '8px',
  color: '#0d47a1',
  cursor: 'pointer',
  fontWeight: '600',
  transition: 'all 0.2s',
  ':hover': {
    backgroundColor: '#e0ecf7'
  }
};

const formStyle = {
  display: 'flex',
  flexDirection: 'column',
  gap: '1.5rem'
};

const inputGroup = {
  display: 'flex',
  flexDirection: 'column',
  gap: '0.5rem'
};

const labelStyle = {
  fontWeight: '600',
  color: '#333',
  fontSize: '0.95rem'
};

const inputStyle = {
  padding: '0.8rem',
  border: '2px solid #e0e7ff',
  borderRadius: '8px',
  fontSize: '1rem',
  transition: 'all 0.3s',
  ':focus': {
    outline: 'none',
    borderColor: '#0d47a1',
    boxShadow: '0 0 0 3px rgba(13, 71, 161, 0.1)'
  }
};

const selectStyle = {
  ...inputStyle,
  appearance: 'none',
  backgroundImage: 'url("data:image/svg+xml;charset=US-ASCII,<svg width="12" height="8" viewBox="0 0 12 8" fill="none" xmlns="http://www.w3.org/2000/svg"><path d="M1 1.5L6 6.5L11 1.5" stroke="%23666" stroke-width="2"/></svg>")',
  backgroundRepeat: 'no-repeat',
  backgroundPosition: 'right 1rem center'
};

const textareaStyle = {
  ...inputStyle,
  minHeight: '120px',
  resize: 'vertical'
};

const submitButtonStyle = {
  padding: '1rem 2rem',
  backgroundColor: '#0d47a1',
  color: 'white',
  border: 'none',
  borderRadius: '8px',
  fontSize: '1rem',
  fontWeight: '600',
  cursor: 'pointer',
  transition: 'all 0.3s',
  marginTop: '1rem',
  ':hover': {
    backgroundColor: '#1565c0',
    transform: 'translateY(-2px)'
  }
};

export default NewTicketForm;
